  return (
    <div className={`sidebarRow ${selected && "selected"}`}>
      {" "}
      // notice_the_quotation // <Icon className="sidebarRow__icon" />
      <h2 className="sidebarRow__title">{title}</h2>
    </div>
  );
}

export default SidebarRow;
